import React from 'react';

const BillDetails = () => {
    // Extract the bill ID from the URL
    const billId = window.location.pathname.split('/').pop();

    return (
        <div>
            <h1>Bill Details</h1>
            <p>Details for bill ID: {billId}</p>
            {/* You can fetch more details based on billId or display static content here */}
        </div>
    );
};

export default BillDetails;
